export function copyText(n){var t=document.createElement("textarea");t.style.top="0";t.style.left="0";t.style.position="fixed";t.value=n;document.body.appendChild(t);t.focus();t.select();try{return document.execCommand("copy"),{Succeeded:!0,Error:""}}catch(i){return{Succeeded:!0,Error:i}}finally{document.body.removeChild(t)}}